--
-- Table structure for table `Personne`
--

DROP TABLE IF EXISTS `Personne`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Personne` (
  `idPersonne` bigint(20) NOT NULL AUTO_INCREMENT,
  `nomPersonne` varchar(255) NOT NULL,
  `prenomPersonne` varchar(255) NOT NULL,
  `mailPersonne` varchar(255) NOT NULL,
  `mdpPersonne` varchar(255) NOT NULL,
  `idRole` bigint(20) NOT NULL,
  `dateDeclaPersonne` date NOT NULL,
  `dateNaissancePersonne` date DEFAULT NULL,
  `villeNaissancePersonne` varchar(255) DEFAULT NULL,
  `adressePersonne` varchar(255) DEFAULT NULL,
  `adresseSuitePersonne` varchar(255) DEFAULT NULL,
  `codePostalPersonne` varchar(5) DEFAULT NULL,
  `villePersonne` varchar(255) DEFAULT NULL,
  `nniPersonne` varchar(15) DEFAULT NULL,
  `idDepartement` bigint(20) DEFAULT NULL,
  `idPays` bigint(20) DEFAULT NULL,
  `sexePersonne` varchar(255) NOT NULL,
  PRIMARY KEY (`idPersonne`),
  KEY `fk_personne_role` (`idRole`),
  KEY `fk_personne_pays` (`idPays`),
  KEY `fk_personne_departement` (`idDepartement`),
  CONSTRAINT `fk_personne_departement` FOREIGN KEY (`idDepartement`) REFERENCES `Departement` (`idDepartement`) ON DELETE CASCADE,
  CONSTRAINT `fk_personne_pays` FOREIGN KEY (`idPays`) REFERENCES `Pays` (`idPays`) ON DELETE CASCADE,
  CONSTRAINT `fk_personne_role` FOREIGN KEY (`idRole`) REFERENCES `Role` (`idRole`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

